INSERT INTO `ACTUS` VALUES (26,'2022-07-18 22:01:53','image-1658181713.webp','Le champion du monde du FC Barcelone dont le contrat expirait le 30 juin dernier prolonge son bail de deux ans avec le club catalan jusqu’en juin 2024.','Sport','gilberto@hotmail.com','Mercato : fin du feuilleton, Ousmane Dembélé prolonge à Barcelone jusqu’en 2024',NULL),(28,'2022-07-14 21:42:21',NULL,'De plus en plus de sociétés communiquent sur leur démarche éco-responsable. Beaucoup se transforment même en entreprises à mission afin d’inscrire celle-ci dans leurs statuts, y compris parmi les TPE-PME.','Economie','ilya.snacel@gmail.com','Recrutement et image de marque : les entreprises doivent montrer patte… verte !',NULL),(37,'2022-07-19 22:45:17','image-1658270717.jpg','Le taux du livret A connaîtra une nouvelle hausse en août. Une bonne nouvelle pour les Français, un peu moins pour les bailleurs sociaux.','Economie','guilhem.derop@gmail.com','Hausse du taux du livret A : menaces à l’horizon pour les HLM',NULL),(38,'2022-07-14 21:39:24',NULL,'En ce jour de fête nationale, c’est l’entraîneur allemand Hans-Albert Blume qui se distingue avec Célestin, lequel brille pour la première fois à ce niveau.','Sport','ilya.snacel@gmail.com','PMU - Arrivée du quinté du jeudi 14 juillet à Longchamp : Le jour de gloire de Célestin',NULL),(42,'2022-07-19 22:43:29','image-1658270609.jpg','L‘Angleterre sera opposée au pays classé deuxième dans le groupe B, soit l’Espagne ou le Danemark. L’Irlande du Nord, nation la plus mal classée de cet Euro, termine dernière avec trois défaites.','Sport','guilhem.derop@gmail.com','Euro féminin : l’Angleterre écrase l’Irlande du Nord et se qualifie pour les quarts avec l’Autriche',NULL),(43,'2022-07-19 22:40:55','image-1658270455.jpg','Le président de la République, Sergio Mattarella, a refusé la démission du Premier ministre Mario Draghi. Ce dernier estime que le « pacte de confiance fondant l’action de ce gouvernement a disparu », après le refus au Parlement, ce jeudi, du vote de confiance du Mouvement 5 Etoiles.','Sport','guilhem.derop@gmail.com','Italie : le président refuse la démission du chef du gouvernement, Mario Draghi',NULL),(47,'2022-07-20 12:17:50','image-1658319470.jpg','Le tribunal d’Evry a ordonné le paiement de cette somme pour le non-respect d’une ordonnance judicaire de novembre 2020 qui demandait à Carrefour de suspendre la mise en œuvre de son projet d’organisation.','Economie','guilhem.derop@gmail.com','Plan d’organisation du travail : Carrefour condamné à verser 18 millions d’euros à la CGT',NULL),(48,'2022-07-20 12:18:10','image-1658319490.jpg','Le régime est le troisième pays, avec la Russie et son alliée la Syrie, à reconnaître ces deux territoires comme étant des Etats indépendants.','International','guilhem.derop@gmail.com','Guerre en Ukraine : la Corée du Nord reconnaît les territoires séparatistes de l’est comme des Etats',NULL),(52,'2022-07-17 21:49:23','image-1658094563.jpg','L’attaquant de 20 ans arrive en prêt du Stade de Reims. Grand espoir du football français, il est la deuxième recrue du PSG cet été après le Portugais Vitinha.','Sport','gilberto@hotmail.com','PSG : Hugo Ekitike, deuxième recrue, prêté par Reims avec option d’achat',NULL),(60,'2022-07-17 20:36:41','image-1658090201.webp','Jean-Pierre Farandou, le PDG du groupe, a estimé que le ferroviaire devrait doubler sa présence dans le domaine des transports pour œuvrer à la décarbonation de la France','Economie','gilberto@hotmail.com','La SNCF souhaite 100 milliards d’euros d’investissement sur 15 ans dans le ferroviaire',NULL),(63,'2022-07-18 22:07:26','image-1658182046.webp','Le Premier ministre britannique fait face à des démissions en cascade dans ses rangs depuis mardi. En cause : les scandales à répétition dans lesquels ils s’est retrouvé impliqué.','International','gilberto@hotmail.com','Royaume-Uni : Boris Johnson s’accroche à son poste, une délégation de ministres réclame sa démission',NULL),(66,'2022-07-19 20:34:55','image-1658262895.jpg','VOICI LA MEILLEURE EQUIPE DU MONDE VIVE 113 LE PETIT PRINCE AINSI QUE SON MIDLANER SAKEN ET SON ADCARRY REKKLES LETSGO VIVE GUILHEM','Sport','fazigamesyt@gmail.com','KARMINE CORP',NULL),(75,'2022-07-20 09:32:18','image-1658309538.jpg','foot femme','Sport',NULL,'foot','admin'),(76,'2022-07-20 18:15:22','image-1658340922.jpg','Alors que de nombreux amendements des députés de l’opposition proposent d’augmenter la valeur maximale d’un titre-restaurant à 15 euros, à Bercy, Bruno Le Maire se dit plutôt prêt à rehausser le plafond journalier de 19 euros à 25 euros.','economie',NULL,'De 19 à 25 euros ? Bras de fer en vue à l’Assemblée autour des titres-restaurant.','admin'),(77,'2022-07-20 19:05:48','image-1658343948.jpg','Soutien fidèle de l’ancien président américain Donald Trump, Steve Bannon est jugé depuis lundi 18 juillet pour avoir refusé de coopérer à l’enquête parlementaire sur l’assaut contre le Capitole.','international','guilhem.derop@gmail.com','Steve Bannon, ex-conseiller de Trump, accusé de se croire «au-dessus de la loi» lors de son procès','admin');
